    content: string;
    colour: string;
}

export const Section = (props: Props) => (
    // <div className="Section">
        <Container fluid className="sectionContainer">
            <Row noGutters className="sectionRow">
                <Col lg="2" className="title">
                    <h3>{props.title}</h3>
                </Col>
                <Col lg="2"className="content">
                    <p>{props.content}</p>
                </Col>
            </Row>
        </Container>
